--comercio
CREATE TABLE comercio (
  id_comercio int(4) NOT NULL AUTO_INCREMENT PRIMARY KEY ,
  codigo_comercio int(4) NOT NULL  COLLATE utf8_spanish_ci,
  nombre_comercio varchar(30) NOT NULL COLLATE utf8_spanish_ci,
  ramo_comercio varchar(100) NOT NULL COLLATE utf8_spanish_ci,
  ubicacion_comercio varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  url varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  nombre_patrocinante varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  tipo_proyecto varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  nombre_server varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  nombre_sistema_operativo varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL, 
  marca_impresora varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL, 
  modelo_impresora varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  nombre_aplicativo varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  integrador varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  nombre_tecnico text (50) COLLATE utf8_spanish_ci DEFAULT NULL,  
  finicio DATE COLLATE utf8_spanish_ci DEFAULT NULL, 
  ffin DATE COLLATE utf8_spanish_ci DEFAULT NULL,      
  status varchar(100) COLLATE utf8_spanish_ci DEFAULT NULL,
  status_impl varchar(1000) COLLATE utf8_spanish_ci DEFAULT NULL,
  observaciones varchar(1000) COLLATE utf8_spanish_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

