  ip_user varchar(25) COLLATE utf8_spanish_ci NOT NULL,
  id_archivo int(11) NOT NULL,
  PRIMARY KEY (id_log),
  KEY user_name (username),
  CONSTRAINT user_name FOREIGN KEY (username) REFERENCES usuario (username)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

